import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

const RotaDetails = () => {
  const { id } = useParams();
  const [rota, setRota] = useState(null);

  useEffect(() => {
    axios.get(`${process.env.REACT_APP_API_URL}/rota/${id}`)
      .then((response) => setRota(response.data))
      .catch((error) => console.error("Erro ao carregar rota:", error));
  }, [id]);

  if (!rota) return <p>Carregando...</p>;

  return (
    <div>
      <h1>{rota.nome}</h1>
      <p>Descrição: {rota.descricao}</p>
      <p>Data: {rota.data}</p>
    </div>
  );
};

export default RotaDetails;
